<style>
.containerbooks {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    position: relative;
    height: 60vh;
    top: -100px;
}
.box-out {
    z-index: -99;
    width: 100%;
    display: flex;
    justify-content: space-between;
    align-items: center;
    position: absolute;
    top: 140px;
}
.box-inner {
    /* display: none; */
    width: 900px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    position: absolute;
    top: 350px;
}
.book {
    width: 180px;
    height: 255px;
    background-color: rgb(62, 71, 152);
    transition: all .3s ease-in-out;
    transform-origin: left center 0px;
    transform-style: preserve-3d;
    border-top-right-radius: 5px;
    border-bottom-right-radius: 5px;
    -webkit-backface-visibility: hidden;
    backface-visibility: hidden;
    overflow: hidden;
}
.box-out .book::after {
    content: " ";
    display: block;
    opacity: 0;
    width: 180px;
    height: 255px;
    position: relative;
    left: 8px;
    transition: all .3s ease;
}

/* ----- book-blur ----- */
.book-blur {
    filter: blur(30px)
}
.box-inner .book {
    margin-left: 90px;
    position: relative;
    top: -194px;
}
/* ----- hover ----- */
.book:hover {
    cursor: pointer;
    transform: rotateY(-28deg) rotateZ(-2deg) scale(1.02);
    -webkit-backface-visibility: hidden;
    backface-visibility: hidden;
    box-shadow: 1px 3px 2px #353d85, 20px 8px 0 #525dc4;
    /* transform: scale(1.02); */
}
.book:hover::after {
    content: " ";
    display: block;
    opacity: 1;
    width: 172px;
    height: 255px;
    position: relative;
    left: 8px;
    background: linear-gradient(-180deg, rgba(255, 255, 255, .1) 0%, rgba(255, 255, 255, 0) 60%);
}
.book:hover::before {
    transform: translateY(9px);
    opacity: 1;
}
.dr {
position: absolute;
  bottom: 16px;
  right: 16px;
  width:100px;
}
.containerbooks h1 {
    font-size: 50px;
    font-weight: 700;
    text-align: center;
    margin-top: 50px;
    margin-bottom: 50px;
}

    .containerbooks{
        display: none;
